import React from "react";
import Slider from "react-slick";
import styled from "styled-components";

const TopCarousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Carousel>
      <Slider {...settings}>
        <div>1</div>
        <div>2</div>
        <div>3</div>
        <div>4</div>
      </Slider>
    </Carousel>
  );
};

export default TopCarousel;

const Carousel = styled.div`
  width: 90%;
  margin: auto;
`;
